import React from "react";
import "./Navbar.css";
import App from "../App";

function Navbar() {
  return (
    <div>
      <div className="navbar">
        <a href="https://google.com">
          <h1>Where in the World ?</h1>
        </a>
        <button onClick={toggleTheme}>
          <img src="./img/moon.svg" alt="moon"></img>
          Dark Mode
        </button>
      </div>
    </div>
  );
}

export default Navbar;
